  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Yazoo
  National Wildlife Refuge outlines Refuge accomplishments during the 1970 calendar
  year.  The report begins by summarizing the weather conditions and habitat conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, rodents, mammals, raptors, fish, reptiles, and diseases-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, collections and receipts, vegetation control, prescribed
  burning, and wildfires. Resource management is outlined; topics include grazing,
  haying, fur harvesting, timber removal, and commercial fishing. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, fishing, violations, and safety. Items of interest and photographs are
  attached\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
